import React from "react";
import {BrowserRouter as Router,
    Link
} from 'react-router-dom';

class HomePageIntro extends React.Component{
    handleClick(){
        console.log("hello");
    }

    render(){
        return(
            <Router>
                <div id="login-container">
                    <div id="vv-logo">      
                    </div>
                    <div id="vv-logo-catch-phrase">
                        A smart and secure way to work
                    </div>

                    <Link to="https://www.google.com/">
                        <button onClick={this.handleClick} className="hp-buttons">Sign up</button>
                    </Link>
            
                    <a href="https://facebook.com/">
                        <button className="hp-buttons">Log in</button>
                    </a>
                </div>
            </Router>
        );
    }   
}

export default HomePageIntro;
